import { configureStore } from '@reduxjs/toolkit';
import { chipsReducer, addChips, removeChips } from './slices/chipsSlice';

const store = configureStore({
    reducer: {
        "chips": chipsReducer,
    },
 });
 console.log(store.getState())
 console.log(addChips(100))

    export { store, addChips, removeChips};
